
module.exports.pre = function(cb){
    if (!global._middleware_method_called) global._middleware_method_called = []
    global._middleware_method_called.push("inner_pre")
    cb()
}
module.exports.before = function(cb) {
    global._middleware_method_called.push("inner_before")
    cb()
}
module.exports.process = function(app,cb) {
    global._middleware_method_called.push("inner_process," + app.module.filename)
    cb()
}
module.exports.after = function(cb) {
    global._middleware_method_called.push("inner_after")
    cb()
}
module.exports.post = function(cb) {
    global._middleware_method_called.push("inner_post")
    cb()
}
